import React, { useEffect, useState } from "react"
import Layout from "../components/Layout"
import { Link } from "react-router-dom"
import { appOperations } from "../modules/app"

import { Button, Box } from "@material-ui/core"
import { connect, DispatchProp } from "react-redux"
import Entries from "../components/Entries/Entries"

type MainType = () => any

class Main extends React.Component  {
  constructor(props) {
    super(props);
    console.log('props',props);
    props.dispatch(appOperations.init());
  }

  render() {
    if (this.props.isLoading) {
      return <div>Loading...</div>;
    }
  return (
    <Layout>
      <Box mb={5}>
        <Button variant="contained" color="primary">
          <Link
            to="calculator"
            style={{ textDecoration: "none", color: "white" }}
          >

          </Link>
        </Button>
        { this.props.user ? (
            <Box><Entries /></Box>
        ): (
          <Box>
            <img loading="lazy"  src="https://cdn.corporatefinanceinstitute.com/assets/budget-1024x617.jpeg" alt="Budget" width="1024" height="617" srcset="//cdn.corporatefinanceinstitute.com/assets/budget-1024x617.jpeg 1024w, //cdn.corporatefinanceinstitute.com/assets/budget-300x181.jpeg 300w, //cdn.corporatefinanceinstitute.com/assets/budget-768x463.jpeg 768w, //cdn.corporatefinanceinstitute.com/assets/budget-600x362.jpeg 600w, //cdn.corporatefinanceinstitute.com/assets/budget-498x300.jpeg 498w, //cdn.corporatefinanceinstitute.com/assets/budget.jpeg 1037w" sizes="(max-width: 1024px) 100vw, 1024px" data-src="" data-srcset="//cdn.corporatefinanceinstitute.com/assets/budget-1024x617.jpeg 1024w, //cdn.corporatefinanceinstitute.com/assets/budget-300x181.jpeg 300w, //cdn.corporatefinanceinstitute.com/assets/budget-768x463.jpeg 768w, //cdn.corporatefinanceinstitute.com/assets/budget-600x362.jpeg 600w, //cdn.corporatefinanceinstitute.com/assets/budget-498x300.jpeg 498w, //cdn.corporatefinanceinstitute.com/assets/budget.jpeg 1037w" data-sizes="(max-width: 1024px) 100vw, 1024px"></img>
          </Box>
        )}

      </Box>

    </Layout>
  );
  }

}

const  mapStateToProps = (state) => {
  console.log(state)
  return {
    isLoading: state.appReducer.isLoading,
    user: state.userReducer.data,
  }
 }

export default connect(mapStateToProps)(Main);
